const Todo = ({todo}) =>{
    return(
        <li>
            <span>{todo.data}</span>
            <span>
                <i className="fas fa-trash"/>
            </span>
            <span>
            <i class="fa-duotone fa-camera-retro" ></i>            </span>
        </li>
    )
}
export default Todo;
